const csvFilePath='./tmk2.csv'
const csv=require('csvtojson')
const fs = require('fs');
csv()
.fromFile(csvFilePath)
.then((jsonObj)=>{
    console.log(jsonObj);
    /**
     * [
     * 	{a:"1", b:"2", c:"3"},
     * 	{a:"4", b:"5". c:"6"}
     * ]
     */ 
})

let jsonArray;
async function change(){
    jsonArray=await csv().fromFile(csvFilePath);
}
// Async / await usage
change();

module.exports = jsonArray;
